import React from "react";

function CitySearched()
{

    GetLocalCityName()
    {
        var city_name = localStorage.getItem('city_name');
        localStorage.removeItem('city_name');
        console.log("CITY NAME = " + city_name);
    }
    return(
        <div>
            <p>this is city searched page</p>
        </div>
    )
    
}

export default CitySearched;
